import React from 'react'

const ChatMessage = ({name, message}) => {
  return (
    <div>

        <img className="h-12 w-12" alt="user" src="https://cdn-icons-png.flaticon.com/512/666/666201.png"/>  
    <span>{name}</span>
    <span>{message}</span>
    </div>
  )
}

export default ChatMessage
